class App extends Component {

  constructor(props) {
    super(props);
    this.state = { apiResponse: "" };
  }

  callAPI() {
      fetch("http://104.128.95.54:9000/testAPI")
          .then(res => res.text())
          .then(res => this.setState({ apiResponse: res }))
          .then(err => err);
  }

  componentDidMount() {
      this.callAPI();
  }

  handleClick = () => {
    //const { history } = this.props;
    this.props.history.push('http://www.baidu.com');
  }

  render(){
    return (
      <form  >
        <label>name:</label>
        <input className="loginName" type="text" value={this.state.apiResponse} />
        <br/>
        <label>pwsd:</label>
        <input className="loginPwsd" type="text" value={this.state.apiResponse} />
        <br/>
        <input type="submit" onClick={this.handleClick} />

      </form>
    );
  }
}

export default App;
